description:
Raids in the Rainforest

Sociopolitical Documentary hosted by Angela NicAoidh, published by BBC broadcasted as part of BBC Soillse series in 2011 - Gaelic (Scottish) narration


Information
------------------------------

Ana Rafaela D'Amico is the youngest national park director in Brazil. The Campos Amazonicos National Park is like a microcosm of all the problems found in Amazonia: illegal logging, cattle breeding, tin mines - and a drugs route that goes right through the middle of the park. Ana Rafaela prepares to wage war on the illegal activies and protect the Amazonian forest.

